  false,\n\t\"url\": null,\n\t\"notes\": \"Observer programs are the most comprehensive
  fishery dependent data collection system for total mortality estimation, protected
  species monitoring and discard data for stock assessments. Observer data is also
  used to track quota in the catch share fishery. Numerous observer program mortality
  and bycatch reports are used by agency and council staff for management of groundfish
  and other fisheries.nnFishery dependent data collected by observers. This data set
  includes the raw observer catch data.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
